import React, { useEffect } from "react";
import { MapContainer, TileLayer, ZoomControl } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";
import L from "leaflet";

function Solution() {
  useEffect(() => {
    const openWeatherMapLayer = L.tileLayer(
      "https://{s}.tile.openweathermap.org/map/clouds/{z}/{x}/{y}.png?appid=e6d8c9c20269bd6d193a610ab4f7d761",
      {
        attribution: "Map data &copy; OpenWeatherMap",
        maxZoom: 19,
        minZoom: 1,
        layername: "precipitation_new",
        apikey: "YOUR_API_KEY_HERE",
      }
    );

    openWeatherMapLayer.addTo(map);
  }, []);

  return (
    <PageContainer>
      <MapContainer
        center={[39.1, -76.1]}
        zoom={10}
        scrollWheelZoom={true}
        zoomControl={false}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org">OpenStreetMap</a>'
        />
        <ZoomControl position="topright" />
      </MapContainer>
    </PageContainer>
  );
}

export default Solution;
